import {CssTextField} from "../Utils/CustomTextFields";
import {DatePicker, LocalizationProvider} from "@mui/x-date-pickers";
import {AdapterDayjs} from "@mui/x-date-pickers/AdapterDayjs";
import ListItemButton from "@mui/material/ListItemButton";
import {Divider, ListItemText} from "@mui/material";
import React, {useState} from "react";
import {User} from "../APIs/UsersAPI";
import List from "@mui/material/List";

type ShowingListPropsType={
    user:User,
    activeButton: string,
    showingList: any[],
    showBonusAuthorizationRequiredMessage: boolean,
    showVaxineAuthorizationRequiredMessage: boolean,
    handleDialogOpen: (value :any) => void,
}

const ShowingListHandler = (props: ShowingListPropsType) => {
    const activeButton = props.activeButton
    const user = props.user
    const showingList = props.showingList
    const showBonusAuthorizationRequiredMessage = props.showBonusAuthorizationRequiredMessage
    const showVaxineAuthorizationRequiredMessage = props.showVaxineAuthorizationRequiredMessage
    const handleDialogOpen = props.handleDialogOpen

    const buttons = ['Dati', 'Vaccini', 'Bonus']
    const [name, setName] = useState(user.name)
    const [surname, setSurname] = useState(user.surname)
    const [birthDate, setBirthDate] = useState<Date | null>(user.birthDate === 0 ? null : new Date(user.birthDate))
    const email = user.email
    const [residence, setResidence] = useState(user.residence)
    const [domicile, setDomicile] = useState(user.domicile)
    const [telephonNumber, setTelephonNumber] = useState(user.telephonNumber)
    const [fiscalCode, setFiscalCode] = useState(user.fiscalCode)


    const handleNameChanged = (event: React.ChangeEvent<HTMLInputElement>) => {
        setName(event.target.value);
    }
    const handleSurnameChanged = (event: React.ChangeEvent<HTMLInputElement>) => {
        setSurname(event.target.value);
    }
    const handleBirthDateChanged = (newValue: Date | null) => {
        setBirthDate(newValue);
    }
    const handleResidenceChanged = (event: React.ChangeEvent<HTMLInputElement>) => {
        setResidence(event.target.value);
    }
    const handleDomicileChanged = (event: React.ChangeEvent<HTMLInputElement>) => {
        setDomicile(event.target.value);
    }
    const handleTelephoneNumberChanged = (event: React.ChangeEvent<HTMLInputElement>) => {
        setTelephonNumber(parseInt(event.target.value));
    }
    const handleFiscalCodeChanged = (event: React.ChangeEvent<HTMLInputElement>) => {
        setFiscalCode(event.target.value);
    }

    return (
        <List sx={{
            width: '80%',
            overflow: 'auto',
            maxHeight: 595,
            position: activeButton === buttons[0] ? 'fixed' : (showBonusAuthorizationRequiredMessage || showVaxineAuthorizationRequiredMessage ? null : 'fixed'),
            top: 90,
            bottom: 100
        }}>
            {
                activeButton === buttons[0] ?
                    <>
                        <CssTextField sx={{input: {color: 'white'}, style: {color: 'white'}, marginTop: '9px'}}
                                      label={'Nome'} defaultValue={name} onChange={handleNameChanged}/>
                        <CssTextField sx={{input: {color: 'white'}, style: {color: 'white'}, marginTop: '9px'}}
                                      label={'Cognome'} defaultValue={surname} onChange={handleSurnameChanged}/>
                        <CssTextField sx={{input: {color: 'white'}, style: {color: 'white'}, marginTop: '9px'}}
                                      label={'Email'} defaultValue={email} InputProps={{readOnly: true}}/>
                        <CssTextField sx={{input: {color: 'white'}, style: {color: 'white'}, marginTop: '9px'}}
                                      label={'Numero di telefono'} defaultValue={telephonNumber}
                                      onChange={handleTelephoneNumberChanged}/>
                        <CssTextField sx={{input: {color: 'white'}, style: {color: 'white'}, marginTop: '9px'}}
                                      label={'Codice fiscale'} defaultValue={fiscalCode}
                                      onChange={handleFiscalCodeChanged}/>
                        <CssTextField sx={{input: {color: 'white'}, style: {color: 'white'}, marginTop: '9px'}}
                                      label={'Residenza'} defaultValue={residence}
                                      onChange={handleResidenceChanged}/>
                        <CssTextField sx={{input: {color: 'white'}, style: {color: 'white'}, marginTop: '9px'}}
                                      label={'Domicilio'} defaultValue={domicile}
                                      onChange={handleDomicileChanged}/>
                        <LocalizationProvider dateAdapter={AdapterDayjs}>
                            <DatePicker
                                inputFormat="DD/MM/YYYY"
                                label="Data inizio"
                                value={birthDate}
                                renderInput={(params) => <CssTextField {...params} sx={{
                                    input: {color: 'white'},
                                    style: {color: 'white'},
                                    marginTop: '9px'
                                }}/>}
                                onChange={(newValue) => {
                                    handleBirthDateChanged(newValue);
                                }}/>
                        </LocalizationProvider>
                        <CssTextField sx={{input: {color: 'white'}, style: {color: 'white'}, marginTop: '9px'}}
                                      label={'Stato'} defaultValue={user.status} InputProps={{
                            readOnly: true,
                        }}/>


                    </>
                    :
                    showingList.map((value, index) => {
                        return (
                            <>
                                <ListItemButton onClick={() => handleDialogOpen(value)}>
                                    <ListItemText primary={value}/>
                                </ListItemButton>
                                <Divider color={'black'}/>
                            </>
                        );
                    })
            }
        </List>
    )
}

export default ShowingListHandler
